    [],nt"num_tags": 34,nt"name": "missisquoi-national-wildlife-refuge-annual-narrative-report-fiscal-year-1975",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Missisquoi
    National Wildlife Refuge  outlines Refuge accomplishments during the 1975 fiscal
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, mammals,
    raptors, fish, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments, vegetation control, and wildfires. Resource
    management is outlined; topics include grazing and haying. A progress report on
    field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, hunting, violations, and safety.
    Items of interest and newspaper articles are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
